import React, {Component} from 'react';

import Aux from '../Aux/Aux';
import Header from '../../components/Nav/Nav';
import Footer from '../../components/Footer/Footer';


class Layout extends Component {

    render () {
        return (
            <Aux>
                <Nav/>
                <main>
                    {this.props.children}
                </main>
                <Footer />
            </Aux>
        )
    }
}

export default Layout;
